CREATE TABLE CBSA
(
    CBSA      BIGINT,
    CBSA_name varchar(255),
    CBSA_type varchar(255)
);
CREATE TABLE state
(
    abbreviation varchar(255),
    name         varchar(255)
);
CREATE TABLE congress
(
    cognress_rep_id varchar(255),
    first_name      varchar(255),
    last_name       varchar(255),
    CID             varchar(255),
    party           varchar(255),
    state           varchar(255),
    abbreviation    varchar(255),
    House           varchar(255),
    District        BIGINT,
    land_area       DOUBLE
);
