CREATE TABLE alias
(
    zip_code BIGINT,
    alias    varchar(255)
);
CREATE TABLE area_code
(
    zip_code  BIGINT,
    area_code BIGINT
);
CREATE TABLE avoid
(
    zip_code  BIGINT,
    bad_alias varchar(255)
);
CREATE TABLE country
(
    zip_code BIGINT,
    county   varchar(255),
    state    varchar(255)
);
CREATE TABLE zip_congress
(
    zip_code BIGINT,
    district varchar(255)
);
